import React from 'react';
import Card from './Card';

const CardList = ({ hbcUsers }) => {
  console.log(hbcUsers);
  return (
      <div className='flex justify-center flex-wrap'>
        {
          hbcUsers.map((pairing, i) => {
            console.log(pairing);
            return (
              <Card
                giverEmail={pairing[0].email}
                giverID={pairing[0].guid}
                giverMotto={pairing[0].motto}
                giverName={pairing[0].name.first + ' ' + pairing[0].name.last}
                key={i}
                receiverEmail={pairing[1].email}
                receiverID={pairing[1].guid}
                receiverMotto={pairing[1].motto}
                receiverName={pairing[1].name.first + ' ' + pairing[1].name.last} 
              />
            )
          })
        }
      </div>
  );
}

export default CardList;
